import React from 'react';

function Home() {
  const userType = localStorage.getItem('userType');

  return (
    <div style={{ padding: '2rem' }}>
      <h1>Welcome to Home Page</h1>
      <p>You are logged in as: <strong>{userType}</strong></p>
    </div>
  );
}

export default Home;
